original_question:
Pravokotno polje je obdano z atletsko stezo, kot je prikazano spodaj. Steza je sestavljena iz dveh robov polja in dveh polkrogov. Dolžina steze je 400 metrov. Kolikšna je največja možna površina polja v kvadratnih metrih?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

